  //   main: ({ match, history }) => <Functions match={match} history={history} />,
  // },
  // {
  //   path: "/admin/:id/edit-product",
  //   exact: false,
  //   main: ({ match, history }) => <Functions match={match} history={history} />,
  // },
  // {
  //   path: "/admin/users",
  //   exact: false,
  //   main: () => <Users />,
  // },
  // {
  //   path: "/admin/hightcharts",
  //   exact: false,
  //   main: () => <HightChartsPage />,
  // },
  {
    path: "/admin/list-products",
    exact: false,
    main: () => <HomeTable />,
  },
  {
    path: "/admin",
    exact: true,
    main: () => <Home />,
  },
  {
    path: "/admin/profile",
    exact: false,
    main: () => <Profile />,
  },
];

export default AdminPage;
